.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 10px;
  font-size: 11px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 2px;
  border-top-right-radius: 2px;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
  border-bottom-left-radius: 2px;
  border-bottom-right-radius: 2px;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 6.66666667px;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #fff;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: #aaaaaa;
}
.github-PrCommitView-title {
  margin: 0 0 .25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 2px;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: #555;
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 10px;
  padding: 0em .2em;
  color: #555;
  font-style: italic;
  font-size: .8em;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  background-color: #43484d;
}
.github-PrCommitView-moreButton:hover {
  background-color: #4f555b;
}
.github-PrCommitView-moreText {
  margin-top: 5px;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 10px;
  line-height: 16px;
  vertical-align: middle;
  color: #5293d8;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
